import {actionTypes} from '../constants/actionTypes'

initialState={
    products:[]
}
 const productReducer=(state,{type,payload})=>{
    switch(type){
      case actionTypes.SET_PRODUCTS:
          return state;
      default :
          return state;
    }

}
export default productReducer;
